import React from 'react';

const Current = (props) => {
    let {location} = props;
    let {current} = props;
    let temp = current.temp_f;
    let uv = current.uv;
    let precip = current.precip_in;
    let humidity = current.humity;
    let icon = current.condition.icon;
    let city = location.name;    

    return (
        <div>
            <h1>Current Weather for: ${city}</h1>

            <p>Temperature: ${temp}</p>
            <p><img src={icon}  /></p>
            <p>UV Index: ${uv}</p>
            <p>Humidity: ${humidity}</p>
            <p>Precipitation: ${precip}</p>

        </div>

    );

    };

export default Current;
